  display: "flex",
  alignItems: "center",
  gap: "16px",
};

const startContainerStyle = {
  display: "flex",
  gap: "4px",
};

const textStyle = {
  lineHeight: "0",
  margin: "0",
};

export default function StarRating({ maxRating }) {
  return (
    <div style={containerStyle}>
      <div style={startContainerStyle}>
        {Array.from({ length: 10 }, (_, i) => (
          <span>{i + 1}</span>
        ))}
      </div>
      <p style={textStyle}>hello</p>
    </div>
  );
}
